import React from "react";
import { Box } from "@mui/material";
import { EmojiEmotionsOutlined, AttachFile, Mic } from "@mui/icons-material";

const Footer = () => {
  return (
    <Box>
      <EmojiEmotionsOutlined />
      <AttachFile />
      <Mic />
    </Box>
  );
};

export default Footer;
